    false,nt"url": null,nt"notes": "This Public Access Plan was developed to
    allow the Army to review andrnnnapprove safety procedures prior to public use occurring
    on Big Oaks National Wildlife Refuge. This Plan is in accordance with the terms
    and conditions of the MOA between the U.S. Fish and Wildlife Service, Army, and
    Air Force . Topics covered include safety briefing protocols, entry procedures,
    types of public use, access, protocols on how public use will be monitored, limited
    and controlled, key control, and use of Refuge by Old Timbers lodge guests.  Additionally
    unexploded ordnance (UXO) response standing operating procedure is covered.",nt"owner_org":
